import styled from "styled-components";

const StyledDub = styled.div`
  position: relative;
  .create {
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    .input {
      padding: 20px;
      img {
        width: 100px;
        height: 100px;
      }
      .field {
        width: 500px;
        height: 25px;
      }
      .file {
        display: none;
      }
    }
    span {
      padding: 10px;
      font-size: 25px;
      font-family: "Dongle", sans-serif;
      border-bottom: 4px solid #03008a;
    }
  }
`;

const Dub = () => {
  return (
    <StyledDub>
      <div className="create">
        <div className="input">
          <label>
            <span>제목</span>
            <input className="field" type="text"></input>
          </label>
        </div>
        <div className="input">
          <label>
            <span>언어</span>
            <input className="field" type="text"></input>
          </label>
        </div>
        <div className="input">
          <label htmlFor="fileInput">
            <span>SRT</span>
            <img src="icon/addfile.png" alt="add" />
            <input className="file" type="file"></input>
          </label>
        </div>
      </div>
    </StyledDub>
  );
};
export default Dub;
